CREATE DATABASE db_404;

USE db_404;

CREATE TABLE users(
    `id` int(11) NOT NULL,
    `correo` varchar(30) NOT NULL,
    `password` varchar(60) NOT NULL,
    `nombre` varchar(60) NOT NULL,
    `preguntas` int(11) NOT NULL,
    `respuestas` int(11) NOT NULL,
    `foto` blob,
    `created_at` timestamp NOT NULL DEFAULT current_timestamp
);

ALTER TABLE `users`
    ADD PRIMARY KEY (id);

ALTER TABLE `users`
    MODIFY `id` int(10) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=1;


DESCRIBE users;

CREATE TABLE preguntas(
    `id` int(11) NOT NULL,
    `titulo` varchar(60) NOT NULL,
    `cuerpo` text NOT NULL,
    `etiquetas` varchar(30) NOT NULL,
    `id_autor` int(11) NOT NULL,
    `respondida` boolean NOT NULL,
    `created_at` timestamp NOT NULL DEFAULT current_timestamp,    
    CONSTRAINT fk_user FOREIGN KEY (id_autor) REFERENCES users(id)
);

ALTER TABLE `preguntas`
    ADD PRIMARY KEY (id);

ALTER TABLE `preguntas`
    MODIFY `id` int(10) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=1;

DESCRIBE preguntas;

CREATE TABLE respuestas(
    `id` int(11) NOT NULL,
    `texto` text NOT NULL,
    `id_pregunta` int(11) NOT NULL,
    `id_autor` int(11) NOT NULL,
    `created_at` timestamp NOT NULL DEFAULT current_timestamp,
    CONSTRAINT fk_autor FOREIGN KEY (id_autor) REFERENCES users(id),
    CONSTRAINT fk_pregunta FOREIGN KEY (id_pregunta) REFERENCES preguntas(id)
);
ALTER TABLE `respuestas`
    ADD PRIMARY KEY (id);

ALTER TABLE `respuestas`
    MODIFY `id` int(10) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=1;

DESCRIBE respuestas;

