INSERT INTO `preguntas` (`id`, `titulo`, `cuerpo`, `etiquetas`, `id_autor`, `respondida`, `created_at`) VALUES
(1, '¿Cual es la diferencia entre position: relative, position: a', 'Sé que estas propiedades de CSS sirven para posicionar un elemento dentro de la página. Sé que estas propiedades de CSS sirven para posicionar un elemento dentro de la página.', '@css@css3', 2, 1, '2022-05-16 11:29:02'),
(2, '¿Cómo funciona exactamente nth-child?', 'No acabo de comprender muy bien que hace exactamente y qué usos prácticos puede tener.', '@css@html', 6, 1, '2022-05-16 11:38:29'),
(3, 'Diferencias entre == y === (comparaciones en JavaScript)', 'Siempre he visto que en JavaScript hay:\r\nasignaciones =\r\ncomparaciones == y ===\r\nCreo entender que == hace algo parecido a comparar el valor de la variable y el === también compara el tipo (como un equals de java).', '@Javascript', 5, 1, '2022-05-16 11:43:02'),
(4, 'Problema con asincronismo en Node', 'Soy nueva en Node... Tengo un modulo que conecta a una BD de postgres por medio de pgnode. En eso no tengo problemas. Mi problema es que al llamar a ese modulo, desde otro modulo, y despues querer usar los datos que salieron de la BD me dice undefined... Estoy casi seguro que es porque la conexion a la BD devuelve una promesa, y los datos no estan disponibles al momento de usarlos.', '@nodejs', 4, 0, '2022-05-16 11:44:44'),
(5, '¿Qué es la inyección SQL y cómo puedo evitarla?', 'He encontrado bastantes preguntas en StackOverflow sobre programas o formularios web que guardan información en una base de datos (especialmente en PHP y MySQL) y que contienen graves problemas de seguridad relacionados principalmente con la inyección SQL.\r\nNormalmente dejo un comentario y/o un enlace a una referencia externa, pero un comentario no da mucho espacio para mucho y sería positivo que hubiera una referencia interna en SO es sobre el tema así que decidí escribir esta pregunta.', '@mysql@sql', 6, 0, '2022-05-16 11:51:23');

INSERT INTO `respuestas` (`id`, `texto`, `id_pregunta`, `id_autor`, `created_at`) VALUES
(1, 'La propiedad position sirve para posicionar un elemento dentro de la página. Sin embargo, dependiendo de cual sea la propiedad que usemos, el elemento tomará una referencia u otra para posicionarse respecto a ella.\r\nLos posibles valores que puede adoptar la propiedad position son: static | relative | absolute | fixed | inherit | initial.', 1, 6, '2022-05-16 11:30:02'),
(2, 'La pseudoclase :nth-child() selecciona los hermanos que cumplan cierta condición definida en la fórmula an + b. a y b deben ser números enteros, n es un contador. El grupo an representa un ciclo, cada cuantos elementos se repite; b indica desde donde empezamos a contar', 2, 1, '2022-05-16 11:39:03');